Album de photographies des oeuvres achetées par l'Etat intitulé : "Ministère de la maison de l'Empereur et des Beaux-Arts. Tableaux commandés ou acquis par le service des Beaux-Arts. Salon de 1865." 
 Oeuvres exposées au salon annuel organisé par le Ministère de la Maison de l'Empereur et des beaux-arts (Surintendance des beaux-arts), en 1865, au Palais des Champs-Elysées à Paris. . 
 Tirage photographique sur papier albuminé représentant : 
 - "Mascarille présentant Jodelet à Cathos et à Madelon" d'après "Les Précieuses ridicules" de Molière, tableau par Jean Hégésippe Vetter, No 2159, présenté hors concours, appartient à l'artiste;
 - "Une batterie de tambours (campagne d'Italie)", tableau par Guillaume Regamey, No 1790, intitulé dans le catalogue "Une batterie de tambours des grenadiers de la garde ; campagne d'Italie";
 - "Galerie de Henri II, à Fontainebleau", tableau par Victor Navlet, No 1591;
 - "Ile de Philoe (Haute-Egypte)", tableau par Louis Mouchot, No 1563;
 - "Naufrage de l'Emily, en 1823", tableau par Louis Gabriel Eugène Isabey, No 1088, intitulé dans le catalogue "Naufrage du trois mâts l'Emily, en 1823";
 - "Vue dans la cressonnière de Veules (Normandie)", tableau par César de Cock, No590, intitulé dans le catalogue "Vue prise dans la cressonnière de Veules (Normandie)";
 - "Au bord d'un torrent", tableau par Paul Alfred de Curzon, No 545, intitulé dans le catalogue "Au bord d'un torrent dans les Apennins";
 - "Le loto", tableau par Charles Chaplin, No 416;
 - "Marche de bohémiens", tableau par Jean Joseph Bellel, No 140.

Album de photographies des oeuvres achetées par l'Etat intitulé : "Direction des Beaux-Arts. Ouvrages commandés ou acquis par le Service des Beaux-Arts. Salon de 1875. Photographié par G. Michelez".
 Oeuvres exposées au salon annuel organisé par le Ministère de l'Instruction publique, des Cultes et des Beaux-Arts (Direction des Beaux-Arts), en 1875, au Palais des Champs-Elysées à Paris.
 Tirage photographique sur papier albuminé représentant :
 - "Pierre Paul Prud'hon", buste, bronze par Emile Louis Truffot, No 3419, commandé ou acquis par le Ministère de l'Instruction publique, des Cultes et des Beaux-Arts, pour la ville de Cluny en Saône-et-Loire;
 - "Jeunesse et Chimère", groupe, bronze par Pierre Granet, No 3120, exempté;
 - "Homme de l'âge de la pierre", statue, bronze par Emmanuel Frémiet, No 3084, précisée dans le catalogue par "réconstitué sur des fragments humains de l'époque";
 - "Le chien de Montargis", d'après B. de Monfaucon, groupe, bronze par Gustave Debrie, No 3003;
 - "La sirène", groupe, bronze par Jean Paul Aubé, No 2849, exempté, commandé ou acquis par le Ministère de l'Instruction publique, des Cultes et des Beaux-Arts.

Album de photographies des oeuvres achetées par l'Etat intitulé : "Direction des Beaux-Arts. Ouvrages commandés ou acquis par le Service des Beaux-Arts. Salon de 1874. Photographié par G. Michelez".
 Oeuvres exposées au salon annuel organisé par le Ministère de l'Instruction publique, des Cultes et des Beaux-Arts (Direction des Beaux-Arts), au Palais des Champs-Elysées à Paris, à partir du 1er mai 1874. 
 Tirage photographique sur papier albuminé représentant : 
 - "Un mariage chez des protestants (Suisse)", tableau par Armand Leleux, No 1160, intitulé dans le catalogue "Un mariage chez les protestants disséminés (Suisse)", présenté hors concours ; 
 - "Louis IX et ses trois intimes", d'après "Vie des Saints" de R. P. Ribadeneira, tableau par Désiré François Laugée, No 1091, présenté hors concours, l'oeuvre appartient à l'artiste ; 
 - "La mort d'Abel", tableau par Pierre Cabanel, No 297, exempté ; 
 - "Une rue à Luzancy", tableau par Alexandre Louis Bouché, No 222 ; 
 - "Saint-Cassien l'hiver (Alpes-Maritimes)", tableau par Henry Bonnefoy, No 210.
